const MainPage = () => {

  const [offset, setOffset] = useState(0);

  React.useEffect(() => {
    window.onscroll = () => {
      setOffset(window.pageYOffset)
    }
  }, []);

  console.log(offset); 

  return (

  <React.Fragment>
    <MainLayout />
    <About />
    <ProjectsMenu />
    <Slider />
    <BlogsMenu />
    <Contact />
  </React.Fragment>
  )
}

export default MainPage
